The Pin type wraps pointer types, guaranteeing that the values behind the pointer won't be moved. For example, Pin<&mut T> , Pin<&T> , Pin<Box<T>> all guarantee that T won't be moved. Most types don't have a problem being moved. These types implement a trait called Unpin . Pointers to Unpin types can be freely placed into or taken out of Pin . For example, u8 is Unpin , so Pin<&mut T> behaves just like a normal &mut T . Some functions require the futures they work with to be Unpin . To use a Future or Stream that isn't Unpin with a function that requires Unpin types, you'll first have to pin the value using either Box::pinned (to create a Pin<Box<T>> ) or the pin_utils::pin_mut! macro (to create a Pin<&mut T> ). Pin<Box<Fut>> and Pin<&mut Fut> can both be used as futures, and both implement Unpin . For example: use pin_utils::pin_mut; // `pin_utils` is a handy crate available on crates.io // A function which takes a `Future` that implements `Unpin`.
fn execute_unpin_future(x: impl Future<Output = ()> + Unpin) { ... } let fut = async { ... };
execute_unpin_future(fut); // Error: `fut` does not implement `Unpin` trait // Pinning with `Box`:
let fut = async { ... };
let fut = Box::pinned(fut);
execute_unpin_future(fut); // OK // Pinning with `pin_mut!`:
