} async fn run_server(addr: SocketAddr) { println!("Listening on http://{}", addr); // Create a server bound on the provided address let serve_future = Server::bind(&addr) // Serve requests using our `async serve_req` function. // `serve` takes a closure which returns a type implementing the // `Service` trait. `service_fn` returns a value implementing the // `Service` trait, and accepts a closure which goes from request // to a future of the response. In order to use our `serve_req` // function with Hyper, we have to box it and put it in a compatability // wrapper to go from a futures 0.3 future (the kind returned by // `async fn`) to a futures 0.1 future (the kind used by Hyper). .serve(|| service_fn(|req| serve_req(req).boxed().compat(TokioDefaultSpawner) )); // Wait for the server to complete serving or exit with an error. // If an error occurred, print it to stderr. if let Err(e) = await!(serve_future) { eprintln!("server error: {}", e); }
} fn main() { // Set the address to run our socket on. let addr = SocketAddr::from(([127, 0, 0, 1], 3000)); // Call our run_server function, which returns a future. // As with every `async fn`, we need to run that future in order for // `run_server` to do anything. Additionally, since `run_server` is an // `async fn`, we need to convert it from a futures 0.3 future into a // futures 0.1 future. let futures_03_future = run_server(addr); let futures_01_future = futures_03_future.unit_error().boxed().compat(TokioDefaultSpawner); // Finally, we can run the future to completion using the `run` function // provided by Hyper. run(futures_01_future);
} If you cargo run now, you should see the message "Listening on http://127.0.0.1:300" printed on your terminal. If you open that URL in your browser of choice, you'll see "thread ... panicked at 'not yet implemented'." Great! Now we just need to actually handle requests. To start, let's just return a static message: async fn serve_req(req: Request<Body>) -> Result<Response<Body>, hyper::Error> { // Always return successfully with a response containing a body with // a friendly greeting ;) Ok(Response::new(Body::from("hello, world!")))
} If you cargo run again and refresh the page, you should see "hello, world!" appear in your browser. Congratulations! You just wrote your first asynchronous webserver in Rust. You can also inspect the request itself, which contains information such as the request URI, HTTP version, headers, and other metadata. For example, we can print out the URI of the request like this: println!("Got request at {:?}", req.uri()); You may have noticed that we're not yet doing anything asynchronous when handling the request-- we just respond immediately, so we're not taking advantage of the flexibility that async fn gives us. Rather than just returning a static message, let's try proxying the user's request to another website using Hyper's HTTP client. We start by parsing out the URL we want to request: let url_str = "http://www.rust-lang.org/en-US/";
let url = url_str.parse::<Uri>().expect("failed to parse URL"); Then we can create a new hyper::Client and use it to make a GET request, returning the response to the user: let res = await!(Client::new().get(url));
// Return the result of the request directly to the user
println!("request finished --returning response");
